import moment from "moment";
import React, { useState } from "react";
import { Calendar, momentLocalizer } from 'react-big-calendar';

const Agenda = () => {


    const localizer = momentLocalizer(moment)

    return(
        <>
        <Calendar
      localizer={localizer}
      events={myEventsList}
      startAccessor="start"
      endAccessor="end"
      style={{ height: 500 }}
    />
        </>
    )
}

export default Agenda;
